        return new Source("{% extends 'base.html.twig' %}

{% block title %}Chiffre d'affaire{% endblock %}

{% block body %}
    <h1>Liste facture de l'année.</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Descriptif</th>
                <th>Tarif</th>
                <th>Paye</th>
                <th>Reste</th>
                <th>Date</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for facture in factures %}
            <tr>
                <td>{{ facture.id }}</td>
                <td>{{ facture.descriptif }}</td>
                <td>{{ facture.tarif }}</td>
                <td>{{ facture.paye }}</td>
                <td>{{ facture.reste }}</td>
                <td>{{ facture.date ? facture.date|date('Y-m-d') : '' }}</td>
                <td>
                    <a href=\"{{ path('facture_show', {'id': facture.id}) }}\">show</a>
                    <a href=\"{{ path('facture_edit', {'id': facture.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"7\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
    <h2>Le chiffre d'affaire est de : {{ chiffre_affaire }} euros.</h2>
<a href=\"{{ path('patient_index') }}\">retour à la liste</a>
{% endblock %}
", "index/chiffre-affaire.html.twig", "/home/csp56/medifact/templates/index/chiffre-affaire.html.twig");
